import React from "react";
import WordContextProvider from "./contexts/WordContext";
import Navbar from "./components/Navbar";
import WordList from "./components/WordList";
import NewForm from "./components/Form";

function App() {
  return (
    <div className="App">
      <WordContextProvider>
        <Navbar />
        <NewForm />

        <WordList />
      </WordContextProvider>
    </div>
  );
}

export default App;
